  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEMs created for this project were developed using the NOAA National Weather
  Service's Weather Forecast Office (WFO) boundaries. Because the WFO boundaries can
  cover large areas, the WFO DEM was divided into smaller DEMs to ensure more manageable
  file sizes. The San Francisco Bay/Monterey (CA) WFO DEM was split into three smaller
  DEMs. They are divided along county lines and are: 1. San Francisco Bay/Monterey
  (CA) WFO - Santa Cruz and Monterey Counties 2. San Francisco Bay/Monterey (CA) WFO
  - Contra Costa, San Francisco, Alameda, San Mateo, and Santa Clara Counties 3. San
  Francisco Bay/Monterey (CA) WFO - Sonoma, Marin, Napa, and Solano Counties This
  metadata record describes the DEM for the San Francisco Bay/Monterey (CA) WFO -
  Sonoma, Marin, Napa, and Solano Counties. The DEM includes the best available lidar
  data known to exist at the time of DEM creation for the coastal areas of Sonoma,
  Marin, Napa, and Solano Counties, that met project specifications. The DEM is derived
  from LiDAR data collected for the California Coastal Conservancy, NOAA and the United
  States Geological Survey between 2009 and 2011. Hydrographic breaklines used in
  the creation of the DEM were obtained from the California Coastal Conservancy, NOAA
  or the USGS. The DEMs are hydro flattened such that water elevations are less than
  or equal to 0 meters. The DEM is referenced vertically to the North American Vertical
  Datum of 1988 (NAVD88) with vertical units of meters and horizontally to the North
  American Datum of 1983 (NAD83). The resolution of the DEM is approximately 5 meters.\",\n\t\"owner_org\":
